import nebula from "./assets/nebula.png";
import viamo from "./assets/viamo.jpg";
import "./App.css";

function App() {
  return (
    <div>
      <h2 className="titulo">Bienvenidos</h2>
      <img src={nebula} alt="nebula" width={190} height={110} className='foto_marca'></img>
      <img src={viamo} alt="viamo" width={190} className='foto_marca'></img>
    </div>
  );
}

export default App;
